      <div
        className="aboutTop"
        style={{ backgroundImage: `url(${MultiplePizzas})` }}
      ></div>
      <div className="aboutBottom">
        
    <h2>About Us !</h2>
    <h3>Welcome To Tasty Pizza</h3>
   <p> Tasty Pizza is a Professional Food Platform. Here we will provide you only interesting content, which you will like very much. We're dedicated to providing you the best of Food, with a focus on dependability and Pizza Delivery. We're working to turn our passion for Food into a booming . We hope you enjoy our Food as much as we enjoy offering them to you.</p>
<p>I will keep posting more important posts on my Website for all of you. Please give your support and love.</p>
<p >Thanks For Visiting Our Site
Have a nice day !</p>
    
        
      </div>
    </div>
  );
}

export default About;
